"use strict";{const duration=1e3,window=document.body,pointup=document.getElementById("pointUp");window.addEventListener("mouseover",e=>{const from=parseInt(pointup.dataset.from,10),to=parseInt(pointup.dataset.to,10),startTime=Date.now(),timer=setInterval(()=>{const elapsedTime=Date.now()-startTime,progress=elapsedTime/duration;progress<1?pointup.textContent=Math.floor(from+progress*(to-from)):(pointup.textContent=to,clearInterval(timer))},16)})}